import React from 'react';
import { useParams } from 'react-router-dom';

const FinalPage = () => {
  const { packageId } = useParams();
  const fetchPackage = async () => {
    try {
      const response = await fetch(`http://localhost:8080/api/v1/packages/${packageId}`);
      const data = await response.json();
      console.log('Package:', data);
    } catch (error) {
      console.error('Error fetching package:', error);
    }
  };
  fetchPackage();
  return (
    <div className='bg-gray-100 min-h-screen py-40 flex text-primary'>
      <h1>Final Page</h1>
      <p>Encomenda feita com sucesso!</p>
      <p>Número da encomenda: {packageId}</p>
      <p>pickupPoint: {data.pickuppoint}</p>
      {/* Exibir outros dados da encomenda */}
    </div>
  );
};

export default FinalPage;
